import React from 'react'
import { NavLink } from 'react-router-dom';
import web from '../src/img/img1.svg'

const Card = () => {
    return (
        <>
                        <div className="col-md-4 col-10 mx-auto">
                        <div classN="card">
                           <img src={web} classN="card-img-top" alt="..." />
                           <div classN="card-body">
                             <h5 classN="card-title">Card title</h5>
                             <p classN="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                             <NavLink to="#" classN="btn btn-primary">Go somewhere</NavLink>
                           </div>
                         </div>

                        </div>

        </>
    )
};

export default Card;
